export const first = {
  position: 'first',
  src: require("../../Svgs/linkedin.svg").default,
  subtitle: "LinkedIn",
  alt: "LinkedIn",
  href:'https://www.linkedin.com/in/alexis-gonzalez-07/'
};
export const second = {
  position: 'second',
  src: require("../../Svgs/mail.svg").default,
  subtitle: "Email Me",
  alt: "Email",
  href:'mailto:alexis.gonzalez07@gmail.com'

};
export const third = {
  position: 'third',
  src: require("../../Svgs/github.svg").default,
  subtitle: "Github",
  alt: "Github",
href:'https://github.com/AlexisGonzalez07'
};
